/**
	Execute the Following script using sys user
**/

CREATE TABLESPACE me_common_data DATAFILE '/u01/app/oracle/product/12.1.0.2/db_1/dbs/me_common_data.dbf' SIZE 1024M EXTENT MANAGEMENT LOCAL UNIFORM SIZE 1M SEGMENT SPACE MANAGEMENT AUTO;
CREATE TABLESPACE me_common_index DATAFILE '/u01/app/oracle/product/12.1.0.2/db_1/dbs/me_common_index.dbf' SIZE 512M EXTENT MANAGEMENT LOCAL UNIFORM SIZE 1M SEGMENT SPACE MANAGEMENT AUTO;

CREATE TABLESPACE me_data DATAFILE '/u01/app/oracle/product/12.1.0.2/db_1/dbs/me_data.dbf' SIZE 1g EXTENT MANAGEMENT LOCAL UNIFORM SIZE 1M SEGMENT SPACE MANAGEMENT AUTO;
CREATE TABLESPACE me_index DATAFILE '/u01/app/oracle/product/12.1.0.2/db_1/dbs/me_index.dbf' SIZE 512M EXTENT MANAGEMENT LOCAL UNIFORM SIZE 1M SEGMENT SPACE MANAGEMENT AUTO;


prompt
prompt Creating USER me_user
prompt ========================
prompt
CREATE USER me_user
    IDENTIFIED BY me_user 
    DEFAULT TABLESPACE me_common_data
    TEMPORARY TABLESPACE temp;

-- Grant/Revoke role privileges 
grant resource to me_user;
grant connect to me_user;

prompt
prompt Creating USER me_schema
prompt ========================
prompt
CREATE USER me_schema
    IDENTIFIED BY me_schema
    DEFAULT TABLESPACE me_common_data
    TEMPORARY TABLESPACE temp;

alter user me_schema quota unlimited on me_common_data;
alter user me_schema quota unlimited on me_common_index;
alter user me_schema quota unlimited on me_data;
alter user me_schema quota unlimited on me_index;

-- Grant/Revoke role privileges 
grant create database link to me_schema;
grant create operator to me_schema;
grant create procedure to me_schema;
grant create profile to me_schema;
grant create public database link to me_schema;
grant create public synonym to me_schema;
grant create type to me_schema;
grant create session to me_schema;
grant create sequence to me_schema;
grant create synonym to me_schema;
grant create table to me_schema;
grant create trigger to me_schema;
grant create view to me_schema;
grant create any view to me_schema;
grant create any directory to me_schema;
grant debug connect session to me_schema;

grant select any dictionary to me_schema;
-- grant select any table to me_schema;

grant query rewrite to me_schema;

grant execute any procedure  to me_schema;
grant execute any type to me_schema;
grant execute on dbms_lock to me_schema;

grant alter session to me_schema;
grant alter session to me_schema;

grant unlimited tablespace to me_schema;

grant drop public database link to me_schema;
-- grant drop any table to me_schema;
grant drop public synonym to me_schema;

-- grant delete any table to me_schema;
grant all on dbms_crypto to me_schema;

--grant specific to queuing
grant aq_administrator_role to me_schema identified by me_schema;
grant execute on dbms_aq to me_schema;
grant execute on dbms_aqadm to me_schema;

grant SCHEDULER_ADMIN TO me_schema;
grant all on DBMS_ISCHED to me_schema;
grant all on DBMS_SCHEDULER to me_schema;


/**
	Execute the Following script using me_schema user
**/

create table me_country_fy_mst(
	COUNTRY_NAME	VARCHAR2(1000 CHAR),
	COUNTRY_CD		CHAR(2 CHAR),
	FY_START		CHAR(5 CHAR),
	FY_END			CHAR(5 CHAR)
)
tablespace me_data;

create table me_user(
	ID				NUMBER not null,
	LOGIN_ID		VARCHAR2(1000 CHAR) not null,
	LOGIN_PWD		VARCHAR2(1000 CHAR) not null,
	USER_FNAME		VARCHAR2(200 CHAR) not null,
	USER_MNAME		VARCHAR2(200 CHAR),
	USER_LNAME		VARCHAR2(200 CHAR),
	USER_EMAIL_ID	VARCHAR2(3000 CHAR) not null,
	USER_PHONE_NO	VARCHAR2(50 CHAR) not null,
	INSERT_DT		DATE not null,
	UPDATE_DT		DATE
)
tablespace me_data;

alter table me_user add constraint me_user_pk1 primary key (id) using index tablespace me_index;

create table ME_CATEG_MST(
	INC_EXP		CHAR(1 CHAR) not null,
	CATEG		VARCHAR2(100 CHAR) not null,
	SUB_CATEG	VARCHAR2(100 CHAR) not null
)
tablespace me_data;

alter table me_categ_mst add constraint me_categ_mst_pk1 primary key (INC_EXP,CATEG,SUB_CATEG) using index tablespace me_index;

create table me_user_settings(
	USER_ID			NUMBER not null,
	SETTING_NAME	VARCHAR2(300 CHAR) not null,
	SETTING_VALUE	VARCHAR2(300 CHAR) not null,
	INSERT_TS		TIMESTAMP not null
)
tablespace me_data;

alter table me_user_settings add constraint me_user_settings_fk1 foreign key (user_id) references me_user(id);


create table ME_USER_CATEG(
	USER_ID		NUMBER not null,
	INC_EXP		CHAR(1 CHAR) not null,
	CATEG		VARCHAR2(100 CHAR) not null,
	SUB_CATEG	VARCHAR2(100 CHAR) not null
)
tablespace me_data;

alter table me_user_categ add constraint me_user_categ_pk1 primary key (user_id,inc_exp,categ,sub_categ) using index tablespace me_index;
alter table me_user_categ add constraint me_user_categ_fk1 foreign key (user_id) references me_user(id);

create table me_bank_mst(
	ID			NUMBER NOT NULL,
	BANK_NAME	VARCHAR2(100 CHAR) NOT NULL)
TABLESPACE ME_DATA;

ALTER TABLE ME_BANK_MST ADD CONSTRAINT ME_BANK_MST_PK1 PRIMARY KEY (ID) USING INDEX TABLESPACE ME_INDEX;

CREATE TABLE ME_ACCOUNT_MST(
	ID				NUMBER NOT NULL,
	USER_ID			NUMBER NOT NULL,
	ACCT_NAME		VARCHAR2(100 CHAR) NOT NULL,
	BANK_ID			NUMBER,
	ACCT_TYPE		VARCHAR2(100 CHAR) NOT NULL,
	INITIAL_AMT		NUMBER,
	INITIAL_AMT_DT	DATE
)
TABLESPACE ME_DATA;

ALTER TABLE ME_ACCOUNT_MST ADD CONSTRAINT ME_ACCOUNT_MST_PK1 PRIMARY KEY (ID) USING INDEX TABLESPACE ME_INDEX;
alter table ME_ACCOUNT_MST add constraint ME_ACCOUNT_MST_fk1 foreign key (user_id) references me_user(id);
alter table ME_ACCOUNT_MST add constraint ME_ACCOUNT_MST_fk2 foreign key (BANK_id) references me_bank_mst(id);

create table ME_GROUP_DTL(
	ID					NUMBER NOT NULL,
	USER_ID				NUMBER NOT NULL,
	GROUP_TYPE			CHAR(1 CHAR) NOT NULL,
	GROUP_NAME			VARCHAR2(30 CHAR) NOT NULL,
	GROUP_USER_ID		number,
	GROUP_USER_EMAIL	VARCHAR2(4000 CHAR)
)
tablespace me_data;

alter table ME_GROUP_DTL add constraint ME_GROUP_DTL_PK1 primary key (id) using index tablespace me_index;
alter table ME_GROUP_DTL add constraint ME_GROUP_DTL_FK1 foreign key (user_id) references me_user(id);
alter table ME_GROUP_DTL add constraint ME_GROUP_DTL_FK2 foreign key (group_user_id) references me_user(id);

create table me_trans_dtl_stg(
	trans_id 	number,
	member_name	varchar2(500 char),
	trans_dt	varchar2(30 char),
	ACCT_NAME	varchar2(100 char),
	CATEG		varchar2(1000 char),
	SUB_CATEG	varchar2(1000 char),
	COMMENTS	varchar2(4000 char),
	TRANS_AMT	varchar2(1000 char)
)
tablespace me_data;

create table me_trans_dtl(
	ID					NUMBER not null,
	USER_ID				NUMBER not null,
	ACCT_ID				NUMBER not null,
	INC_EXP				CHAR(1 CHAR) not null,
	CATEG				VARCHAR2(100 CHAR) not null,
	SUB_CATEG			VARCHAR2(100 CHAR) not null,
	TRANS_DT			DATE not null,
	TRANS_AMT			NUMBER(10,2) not null,
	TRANS_DESC			VARCHAR2(4000 CHAR),
	IS_SPLIT			NUMBER(1) DEFAULT 0 NOT NULL
)
tablespace me_data;

alter table me_trans_dtl add constraint me_trans_dtl_pk1 primary key (id) using index tablespace me_index;
alter table me_trans_dtl add constraint me_trans_dtl_fk1 foreign key (user_id,inc_exp,categ,sub_categ) references me_user_categ(user_id,inc_exp,categ,sub_categ);
alter table me_trans_dtl add constraint me_trans_dtl_chk1 check (IS_SPLIT in (1,0));

create table me_trans_group_map(
	TRANS_ID	NUMBER not null,
	GROUP_NAME	VARCHAR2(30 CHAR),
	USER_ID		NUMBER,
	USER_EMAIL	VARCHAR2(4000 CHAR)
)
tablespace me_data;

alter table me_trans_group_map add constraint me_trans_group_map_fk1 foreign key (trans_id) references me_trans_dtl(id);
alter table me_trans_group_map add constraint me_trans_group_map_fk2 foreign key (user_id) references me_user(id);


